        return (
            <Provider store={store}>
                <Fragment>
                    <BrowserRouter>
                        <div>
                            <button onClick={() => this.handleClick()}>tt</button>
                            <button onClick={() => this.h()}>gs</button>
                        </div>
                        <div>
                            <Route path='/TicTacToe' exact component={TicTacToe}></Route>
                            <Route path='/GoodsShow' exact component={GoodsShow}></Route>
                        </div>
                    </BrowserRouter>
                </Fragment>
            </Provider>
        )
    }
}
